import React, { useState } from 'react';
import './Result.styles.css';
import { useSelector } from 'react-redux';



export default function Result({cardsNumber,completeCardsNumber}) {
 const {totalMoves} = useSelector((state) => state.movesSlice)
 let [prec,setPrec]=useState(0);

    if(totalMoves !== 0 && totalMoves >= cardsNumber/2 ){
     setPrec(Math.ceil( ( 1 - ( (totalMoves-cardsNumber/2) / totalMoves) )*100));
 }
 
  return (
    <div  className='result'>
        <div class="wrapper">
            <div id="bottom-bar">
                <div class="bottom-bar-element">
                    Total Moves: {totalMoves}
                </div>
                <div class="bottom-bar-element">
                    precentage:  {prec !== 0 ? prec : <span><i class="fa-solid fa-spinner fa-spin"></i></span>}               
                </div>
                <div class="bottom-bar-element">
                    
                </div>
                <div class="bottom-bar-element">
                
                    
                </div>
            </div>
        </div>
    </div>
    )
}
